    public BaseResponse baseResponse;
    public String baiduid;
    public String contentInfo;
    public List<Item> items;
    public String bizCode;

    @Override
    public String toString() {
        StringBuilder builder = new StringBuilder();
        builder.append("{baseResponse: ");
        builder.append(baseResponse);
        builder.append(", baiduid: ");
        builder.append(baiduid);
        builder.append(", contentInfo: ");
        builder.append(contentInfo);
        if (items != null) {
            builder.append(", items: ");
            builder.append(Arrays.toString(items.toArray(new Item[items.size()])));
        }
        builder.append(", bizCode: ");
        builder.append(bizCode);
        builder.append("}");
        return builder.toString();
    }

    public static class BaseResponse {
        public String msg;
        public int code;

        public String getMsg() {
            return msg;
        }

        public void setMsg(String msg) {
            this.msg = msg;
        }

        public int getCode() {
            return code;
        }

        public void setCode(int code) {
            this.code = code;
        }

        @Override
        public String toString() {
            return "{msg: " + msg + ", code: " + code + "}";
        }
    }

    public static class Item {
        public String type;
        public String data;
        public int commentCounts;

        public static class CommentCountsComparator implements Comparator<Item> {

            @Override
            public int compare(Item o1, Item o2) {
                return new Integer(o2.commentCounts).compareTo(o1.commentCounts);
            }
        }

        @Override
        public String toString() {
            return "{type: " + type
                    + ", data: " + data
                    + ", commentCounts: " + commentCounts + "}";
        }
    }

    public static class NewsItem extends Item {
        public NewsData data;

        public static class IsTopComparator implements Comparator<NewsItem> {

            @Override
            public int compare(NewsItem o1, NewsItem o2) {
                return new Integer(o2.data.isTop).compareTo(o1.data.isTop);
            }
        }

        public static class ReadCountsComparator implements Comparator<NewsItem> {

            @Override
            public int compare(NewsItem o1, NewsItem o2) {
                return new Integer(o2.data.readCounts).compareTo(o1.data.readCounts);
            }
        }

        public static class RecommendComparator implements Comparator<NewsItem> {

            @Override
            public int compare(NewsItem o1, NewsItem o2) {
                return new Integer(o2.data.recommend).compareTo(o1.data.recommend);
            }
        }
    }

